import React, { useState, useEffect } from 'react';

const CreateTechnician = () => {
  const [services, setServices] = useState([]);
  const [cities, setCities] = useState([]);
  const [areas, setAreas] = useState([]);
  const [selectedCity, setSelectedCity] = useState('');
  const [formData, setFormData] = useState({
    user_name: '',
    password: '',
    phone_number: '',
    email: '',
    experienced_year: '',
    location: '',
    service_names: [],
  });

  // Fetch cities from the backend
  useEffect(() => {
    fetch('/api/cities')
      .then((response) => response.json())
      .then((data) => setCities(data))
      .catch((error) => console.error('Error fetching cities:', error));
  }, []);

  // Fetch services from the backend
  useEffect(() => {
    fetch('/api/services')
      .then((response) => response.json())
      .then((data) => setServices(data))
      .catch((error) => console.error('Error fetching services:', error));
  }, []);

  // Handle city selection and fetch areas under the city
  const handleCityChange = (e) => {
    const cityId = e.target.value;
    setSelectedCity(cityId);

    fetch(`/api/areas/${cityId}`)
      .then((response) => response.json())
      .then((data) => setAreas(data))
      .catch((error) => console.error('Error fetching areas:', error));
  };

  // Handle form input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Handle service selection
  const handleServiceChange = (e) => {
    const { value, checked } = e.target;
    const updatedServiceNames = checked
      ? [...formData.service_names, value]
      : formData.service_names.filter((name) => name !== value);

    setFormData({ ...formData, service_names: updatedServiceNames });
  };

  return (
    <div>
      <h2>Create Technician</h2>
      <form>
        <div>
          <label>User Name:</label>
          <input
            type="text"
            name="user_name"
            value={formData.user_name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Phone Number:</label>
          <input
            type="text"
            name="phone_number"
            value={formData.phone_number}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Experience Years:</label>
          <input
            type="number"
            name="experienced_year"
            value={formData.experienced_year}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>City:</label>
          <select value={selectedCity} onChange={handleCityChange} required>
            <option value="">Select City</option>
            {cities.map((city) => (
              <option key={city.city_id} value={city.city_id}>
                {city.city_name}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label>Area:</label>
          <select
            name="location"
            value={formData.location}
            onChange={handleInputChange}
            required
          >
            <option value="">Select Area</option>
            {areas.map((area) => (
              <option key={area.zipcode} value={area.area}>
                {area.area}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label>Services:</label>
          {services.map((service) => (
            <div key={service.service_name}>
              <input
                type="checkbox"
                value={service.service_name}
                onChange={handleServiceChange}
              />
              {service.service_name}
            </div>
          ))}
        </div>
        <button type="submit">Create Technician</button>
      </form>
    </div>
  );
};

export default CreateTechnician;
